swaptrade_intro_dialog_desc_cross_value_:
The value difference of this transaction is shown as:
· {chain} chain network fee: {value1}
· {bridge} bridge fee: {value2}

If the value difference is much bigger while the fees listed above are relatively small, it’s because the swap amount has affected the depth of this token pair’s liquidity pool.

swaptrade_intro_tooltip_trade_including_:
In cross-chain swaps, the cost includes the network fee of the payment network and a portion of the cross-chain bridge fee. Fee breakdown of this transaction:
• Network fee: {fromChainPriceAndFee}
• Cross-chain bridge fee: {bridgePriceAndFee}
The network fee covers miner costs and isn’t charged by our platform.

swaptrade_mid_dialog_desc_est_network_fe:
In cross-chain transactions, this fee includes the network fees for the pay token’s network and the cross-chain bridge.

The fee for this transaction is made up of:
· {chain} network fee: {value1}
· {bridge} network fee: {value2}

We don’t charge network fees as they are payments to the miners.

swaptrade_modal_desc_crosschain_valuedif:
Fees factored into the value difference of this cross-chain swap are:
• Cross-chain bridge fee: {bridgePriceAndFee}
• Network fee on the destination chain: {toChainPriceAndFee}
• When you trade a certain amount of tokens, it affects the liquidity pool's depth. This, in turn, changes the overall availability and price of the tokens, leading to noticeable differences in prices.

